import React from 'react';
import styled from 'styled-components';
import Bg1 from '@mevron/cross-core/assets/svg-icon/color-svg/st-1.svg';

const StatsCard = () => {
    const Container = styled.div`
        background-position: right bottom;
        background-repeat: no-repeat;
    `;
    return (
        <Container className="box bg-secondary-light pull-up">
            <div className="box-body">
                <div className="flex-grow-1">
                    <div className="d-flex align-items-center pe-2 justify-content-between">
                        <div className="d-flex">
                            <span className="badge badge-primary me-15">New Cases</span>
                        </div>
                    </div>
                    <h4 className="mt-25 mb-5">It & software</h4>
                    <p className="text-fade mb-0 fs-12">45 Days Left</p>
                </div>
            </div>
        </Container>
    );
};

export default function Stats() {
    return (
        <div className="row">
            <div className="col-12">
                <div className="box no-shadow mb-0 bg-transparent">
                    <div className="box-header no-border px-0">
                        <h4 className="box-title">Analysis</h4>
                    </div>
                </div>
            </div>
            <div className="col-xl-3 col-md-6 col-12">
                <StatsCard />
            </div>
        </div>
    );
}
